import React from "react";
import "./style.scss";
import { treeLinkType } from "./TreeLink";

function TreeSection({ children, title }: { title: string; children: treeLinkType[] }): JSX.Element {
	return (
		<li key={title} className="tree-section">
			<input type="checkbox" id={title} />
			<label htmlFor={title}>{title}</label>
			<ul>
				{children.map((e) => (
					<>{e}</>
				))}
			</ul>
		</li>
	);
}

export default TreeSection;
